// FeaturesSection.js
import React from 'react';

const FeaturesSection = () => {
  return (
    <section className="features">
      <h2>Features</h2>
      <ul>
        <li>Feature 1</li>
        <li>Feature 2</li>
        <li>Feature 3</li>
      </ul>
    </section>
  );
};

export default FeaturesSection;
